import React from 'react';

const ContactUs = () => {
  return (
    <div style={{ padding: "2rem" }}>
      <h1>Contact Us</h1>
      <p>We care a lot about you. If you have any questions or need help, feel free to reach out!</p>
    </div>
  );
};

export default ContactUs;
